import Header from './Header';

const layoutStyle = {
  marginTop: 10,
  marginBottom: 20,
  padding: 20,
  border: '1px solid #DDD'
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.content.map((el)=>{
      <div>
        <h3>{el.titleResult}</h3>
        <p>{el.companyResult}</p>
        <p>{el.summaryResult}</p>
        <p>{el.addressResult}</p>
      </div>
    })}
  </div>
);

export default Layout;
